  `renwlx` int(11) DEFAULT NULL COMMENT '任务类型',
  `lzry` int(11) DEFAULT NULL COMMENT '流转人员',
  `fabry` int(11) DEFAULT NULL COMMENT '发布人员-用户表ID',
  `fabsj` datetime DEFAULT NULL COMMENT '发布时间',
  `shsj` datetime DEFAULT NULL COMMENT '审核时间',
  `yaoqwcsj` datetime DEFAULT NULL COMMENT '要求完成时间',
  `uptime` datetime DEFAULT NULL COMMENT '更新时间',
  `biaoz` int(11) DEFAULT NULL COMMENT '状态标志  对应二级代码表',
  `jiedfzr` int(11) DEFAULT NULL COMMENT '当前阶段负责人-对应用户表',
  `shbz` varchar(5) DEFAULT '0' COMMENT '实施部主管是否审核通过的标志',
  `shry_id` int(11) DEFAULT NULL COMMENT '审核人员的id，对应用户表',
  `rw_state` int(11) DEFAULT '0' COMMENT '问题的关闭状态',
