  `xiangm_id` int(11) DEFAULT NULL COMMENT '对应的项目id--对应项目表',
  `mk_name` text COMMENT '对应的模块名称',
  `cqbeizhu` text COMMENT '重启任务的备注',
  `cqry` int(11) DEFAULT NULL COMMENT '重启任务的人',
  `cqsj` datetime DEFAULT NULL COMMENT '重启任务的时间',
  PRIMARY KEY (`renwid`),
  UNIQUE KEY `renwid` (`renwid`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

