  `zirwid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '子任务ID--接收任务时产生',
  `renwid` int(10) unsigned NOT NULL COMMENT '对应任务主表ID',
  `zirenwnr` text COMMENT '内容',
