  `jiedyjwcsj` datetime DEFAULT NULL COMMENT '本阶段预计完成时间',
  `jiedsjwcsj` datetime DEFAULT NULL COMMENT '本阶段实际完成时间',
  `lzry` int(11) DEFAULT NULL COMMENT '操作人员',
  `lzsj` datetime DEFAULT NULL COMMENT '流转时间',
  `biaoz` int(10) NOT NULL COMMENT '子任务标志',
  `jiedgs` double(14,2) DEFAULT NULL COMMENT '阶段工时',
  `jiessj` datetime DEFAULT NULL COMMENT '接收时间',
  `jiedfzr` int(11) DEFAULT NULL COMMENT '上阶段负责人',
