  `gbryid` int(11) unsigned DEFAULT NULL COMMENT '关闭人员id',
  `cqry` int(11) unsigned DEFAULT NULL COMMENT '重启任务的人',
  `cqsj` datetime DEFAULT NULL COMMENT '重启任务的时间',
  PRIMARY KEY (`zirwid`),
  UNIQUE KEY `zirwid` (`zirwid`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

